<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>WhatsApp Account Found</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
            background-color: #121212;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        .container {
            width: 90%;
            max-width: 360px;
            background-color: #000000;
            border-radius: 20px;
            box-shadow: 0 5px 15px rgba(0, 0, 0, 0.5);
            overflow: hidden;
            text-align: center;
            color: #ffffff;
        }

        .header {
            font-size: 18px;
            font-weight: bold;
            margin: 20px 0 10px;
        }

        .profile-section {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 15px;
            padding: 20px;
        }

        .profile-section img {
            width: 60px;
            height: 60px;
            border-radius: 50%;
        }

        .profile-info {
            text-align: left;
        }

        .profile-info p {
            margin: 0;
        }

        .profile-info .number {
            font-size: 16px;
        }

        .profile-info .label {
            color: #9e9e9e;
            font-size: 14px;
        }

        .button {
            background-color: #00C853;
            color: #ffffff;
            padding: 15px;
            border: none;
            border-radius: 50px;
            font-size: 16px;
            font-weight: bold;
            cursor: pointer;
            margin: 20px;
            width: 90%;
        }

        .button:hover {
            background-color: #00B74A;
        }
    </style>
